    false,nt"url": null,nt"notes": "NODC Accession 0104367 includes chemical,
    optical and other data collected aboard the THOMAS G. THOMPSON during cruise TN268
    in the Coastal Waters of SE Alaska and North Pacific Ocean from 2011-08-11 to 2011-09-01.
    These data include Attenuation/Transmission, CONDUCTIVITY, CURRENT SPEED - EAST/WEST
    COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V), DEPTH - BOTTOM, DEPTH
    - OBSERVATION, DISSOLVED OXYGEN, FLUORESCENCE, HYDROSTATIC PRESSURE, SALINITY and
    WATER TEMPERATURE. The instruments used to collect these data include ADCP, CTD,
    GPS, echo sounder, fluorometer, oxygen meter and transmissometer. These data were
    collected by John Delaney of University of Washington as part of Ocean Observatories
    Initiative (OOI): VISIONS'11. The Lamont-Doherty Earth Observatory (LDEO) submitted
    these data to NODC as part of the NSF sponsored Rolling Deck to Repository (R2R)
    program.nnThe CTD data submitted by the originator represent the raw data suite.
    Processed versions of the data were generated by NODC. The ADCP data represent the
    raw and automated processed data set. Post processed quality assessed data are not
    available in this accession.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
